EXCEPTION
    WHEN OTHERS THEN
        DBMS_OUTPUT.ENABLE(BUFFER_SIZE => NULL);
        DBMS_OUTPUT.PUT_LINE('Unable to create constraint: ' || SQLERRM);
END;
            {%- endset -%}
