macro.fsc_utils.generate_datashare_udf_d.macro_sql:
{% macro generate_datashare_udf_ddl() %}
{#
    generate UDF DDL for datashare

    Return: UDF DDL for datashare
 #}
    {%- set schema = "UTILS" -%}
    {%- set udfs = fromyaml(fsc_utils.udf_configs(schema)) -%}
    {%- set combined_ddl = [] -%}
    {%- for udf in udfs -%}
